// Helper functions
export function getCityByName(name: string): City | undefined {
  return cities.find(city => city.name.toLowerCase() === name.toLowerCase());
}

export function getCitiesByCountry(country: string): City[] {
  return cities.filter(city => city.country.toLowerCase() === country.toLowerCase());
}

export function getCitiesByType(type: string): City[] {
  return cities.filter(city => 
    city.cityType1 === type || 
    city.cityType2 === type || 
    city.cityType3 === type || 
    city.cityType4 === type
  );
}

export function getCitiesByCrimeRange(min: number, max: number): City[] {
  return cities.filter(city => city.crimeIndex >= min && city.crimeIndex <= max);
}

export function searchCities(query: string): City[] {
  const lowerQuery = query.toLowerCase();
  return cities.filter(city =>
    city.name.toLowerCase().includes(lowerQuery) ||
    city.country.toLowerCase().includes(lowerQuery) ||
    city.cityType1.toLowerCase().includes(lowerQuery) ||
    city.cityType2.toLowerCase().includes(lowerQuery) ||
    city.cityType3.toLowerCase().includes(lowerQuery) ||
    city.cityType4.toLowerCase().includes(lowerQuery)
  );
}

export function getMegaCities(): City[] {
  return cities.filter(city => city.populationType === 'Mega City');
}

export function getLargeCities(): City[] {
  return cities.filter(city => city.populationType === 'Large City');
}
